import React from 'react';
import Search from './Search';

const Navbar = ({ showSearch }) => {
  return (
    <nav 
      className="navbar navbar-expand-md sticky-top py-3 navbar-dark" 
      id="mainNav" 
      style={{ zIndex: 1000,
        left: '100px',
       }}
    >
      <div className="container">
        <div className="collapse navbar-collapse" id="navcol-1">
          {showSearch && <Search />}
          <ul className="navbar-nav mx-auto">
            <li className="nav-item"><a className="nav-link active" href="MenuPage">Menu</a></li>
            <li className="nav-item"><a className="nav-link" href="Cart">Cart</a></li>
          </ul>
          <a className="btn btn-primary shadow" role="button">Sign up</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
